import React from "react";
import IconLinkedin from "../icons/linkedin"
import IconInstagram from "../icons/instagram";
import IconGitHub from "../icons/github";

const Socials = () => {
    return (
        <div className="flex flex-col min-w-36 items-center justify-end h-svh">
            <div className="absolute z-10  w-full h-fit pb-12 pt-6 flex flex-col items-center ">
                <a href='https://www.linkedin.com/in/katherineytye/'> <IconLinkedin/></a>
                <a href='https://www.instagram.com/_chezkath/'> <IconInstagram/></a>
                <a href='https://github.com/kyoety'> <IconGitHub/></a>
            </div>

        </div>
    );
};  

export default Socials;
